import React, { useEffect, useState } from 'react';
import './App.css';
import Box from './Box';

const App = () => {



  const [clickedState, setClickedState] = useState({})


   const handleBoxClick = (key) => {
     const newClickedState = {...clickedState, key: true}
     setClickedState(newClickedState)
   }
   console.log(clickedState)

  return (
    <div>
      <div className='first-div flex wrapper-div'>
        <Box key={0} boxClicked={handleBoxClick} clicked={clickedState[0]}/>
        <Box key={1} boxClicked={handleBoxClick} clicked={clickedState[1]}/>
        <Box key={2} boxClicked={handleBoxClick} clicked={clickedState[2]}/>
      </div>
      <div className='second-div flex wrapper-div'>
        <Box key={3} boxClicked={handleBoxClick} clicked={clickedState[3]}/>
      </div>
      <div className='third-div flex wrapper-div'>
        <Box key={4} boxClicked={handleBoxClick} clicked={clickedState[4]}/>
        <Box key={5} boxClicked={handleBoxClick} clicked={clickedState[5]}/>
        <Box key={6} boxClicked={handleBoxClick} clicked={clickedState[6]}/>
      </div>
    </div>
  )
}

export default App;
